Description. Meristics: median lateral scale rows ( 65–67 ) 68–88 ( 89–91 ); scales above midline 8–11 ; scales below midline ( 7 ) 8–10 ( 11 ); peduncle scales ( 16–17 ) 18–22 ; predorsal scales 31–44 ( 45–49 ); interdorsal scales ( 9 ) 10–15 ( 16–17 ); prepelvic scales ( 20 ) 21–27 ( 28–30 ); anus-anal-fin scales 2–6 ; postdorsal scales ( 12 ) 13–20 ( 21– 22 ); postanal scales ( 8 ) 9–14 ( 15 ); first dorsal (III) IV–VI; second dorsal I, 8–11 ; pectoral 11–13 ( 14 ); pelvic 6 ; anal-fin I,( 18 ) 19–25 ( 26 ); caudal ( 15–16 ) 17 ( 18 ) (
Table 2
).

Premaxillary long, weakly protrusible, curving ventrally midway along length, creating muzzle-like snout; terminal mouth, with moderately long, posteriorly curved, pointed, conical teeth. Forked caudal fin; second dorsal and anal fins falcate; anal fin long, extending from anterior of first dorsal to posterior of second dorsal; pelvic fin extending to anus; first dorsal-fin origin opposite of anal-fin origin; pectoral fin pointed, extending to insertion of pelvic fin. First dorsal spinous, second dorsal with one anterior spine followed by branched rays. Genital papilla short in males, absent in females (
Grier et al. 1990
). Lateral line nearly absent, pored scales, if present, always found posterior to first dorsal usually concentrated on peduncle. Scales cycloid, extending onto caudal fin, absent from other fins; opercle scaled, scales extending to a spot below front of eye; top of head with or without scales, if present may extend to front of eye. Dorsal profile ascending gradually from tip of snout to supraoccipital, profile from supraoccipital to anterior insertion of second dorsal straight, and descending gradually to dorsal procurrent caudal-fin rays. Ventral profile forming gentle arc from snout to ventral procurrent caudal-fin rays.

Color in life. Body translucent, with yellow or green tint (
Fig. 7
). Breeding males with red muzzle and yellow to orange second dorsal, anal, and caudal fins. Midlateral silver band, narrowest on peduncle, broadening and fading anteriorly. Scales above midline and on dorsum outlined with melanophores, forming weak black stripe along center of dorsum. Venter with black stripe originating posterior to anus and terminating at the origin of the caudal fin. Distal one-third of first dorsal fin with melanophores on membranes forming a black band in males, not as pronounced in females. Head covered in melanophores, with supraoccipital densely pigmented, chin pigmented, dark spot on lower jaw at rear margin of mouth. Iris silver, dusky dorsally in some individuals, inside of mouth with scattered melanophores along margin and on outside of cheeks. Spines and rays outlined in melanophores, except on pelvic fin, which is devoid of pigment. Silver peritoneum visible through body wall.

Color in alcohol: Body pallid, lateral silver stripe along the midline overlaying a dark stripe, fading and broadening anteriorly (
Fig. 6
). Scales above lateral stripe outlined in melanophores, dorsum with black stripe along middle. Venter with black stripe along middle, faint anterior to pelvic fin. Distal one-third of first dorsal fin with melanophores on membranes forming a black band in males, but not as pronounced in females. Head covered in melanophores, with occiput densely pigmented, lower jaw pigmented with dark spot at rear of mouth. Iris silver, dusky dorsally in some individuals, inside of mouth with scattered melanophores along margin and on outside of cheeks. Spines and rays outlined in melanophores, except in pelvic fin that is devoid of pigment.

Etymology. Patronymic for O . C. Van Hyning, former Curator of Reptiles and Fishes of The Florida State Museum and collector of the holotype (
Bean & Reid 1930
).
